import '../../styles/Card.css';

function Card({ label, title, picture }) {
    return (
        <div className="col-6 mx-4 wrapper  ">

                <div className="label mb-4">{label}</div>

                <img className="mb-4" src={picture} alt="freelance" />

                <div className="text-center font-weight-bold">{title}</div>

        </div>
    )
}

export default Card
